import React, { Component } from 'react'

export default class RouletteWheel extends Component {
    render() {
        return (
            <div>

                <video width="320" height="240" controls>
                    <source src="https://ak2.picdn.net/shutterstock/videos/15687382/preview/stock-footage-the-wheel-of-fortune-or-lucky-spin-animation-was-created-by-three-dimensional-video-is-included.webm" type="video/mp4"/>
                </video>
            </div>
        )
    }
}
